						["custom"] = "function(allstates, event, ...)\n    if event == \"CHAT_MSG_RAID_BOSS_EMOTE\"\n    then\n        local text, _, _, _, playerName2 = ...\n        if text \n        and (text:find(\"spell:295607\") or text:find(\"spell:295606\"))\n        and playerName2 and playerName2 == WeakAuras.me then\n            local spellID = tonumber(string.match(text, \"%d%d%d%d%d%d\"))\n            if spellID then\n                local _,_,spellicon = GetSpellInfo(spellID)\n                local guid = UnitGUID(\"boss1\")\n                if guid and spellicon then\n                    --forced to manually input castTime since event might fire pre-cast, making UnitCastingInfo unreliable.\n                    allstates[guid] = {\n                        show = true,\n                        changed =  true,\n                        progressType = \"timed\", \n                        duration = 4,\n                        expirationTime = 4 + GetTime(),\n                        autoHide = true,\n                        spellID = spellID,\n                        icon = spellicon,\n                    }\n                end\n            end\n        end\n    end\n    if (\n        event == \"UNIT_SPELLCAST_SUCCEEDED\"\n        or event == \"UNIT_SPELLCAST_STOP\"\n        or event == \"UNIT_SPELLCAST_FAILED\"\n        or event == \"UNIT_SPELLCAST_INTERRUPTED\"\n    )    \n    then \n        local unit, castGUID, spellID = ...\n        if unit\n        and UnitExists(unit)\n        and spellID\n        and (spellID == 295607 or spellID == 295606)\n        then\n            local guid = UnitGUID(unit)\n            if guid then\n                local state = allstates[guid]\n                if state then\n                    state.show = false\n                    state.changed = true\n                end\n            end\n        end\n    end\n    return true\nend",
