						["custom"] = "function(allstates, e, u)\n    if e == \"INSTANCE_ENCOUNTER_ENGAGE_UNIT\" then\n        for _, state in pairs(allstates) do\n            state.show = false;\n            state.changed = true;\n        end\n        for i = 1,5 do\n            local unit = \"boss\"..i\n            local guid = UnitGUID(unit)\n            if guid and aura_env.guids[select(6, strsplit(\"-\", guid))] then\n                local state = allstates[guid]\n                local current = UnitPower(unit)\n                if not state and current >= 85 then\n                    local _, _, ID = GetInstanceInfo()\n                    local name = (ID ~= 16 and \"Absorb Inc\") or (ID == 16 and \"Split Inc\")\n                    local icon = (ID ~= 16 and 607865) or (ID == 16 and 460699)\n                    if name and icon then\n                        allstates[guid] = {\n                            show = true,\n                            changed = true,\n                            progressType = \"static\",\n                            energy = current,\n                            icon = icon,\n                            name = name\n                        }\n                    end\n                end\n            end\n        end\n    end\n    if e == \"UNIT_POWER_UPDATE\" then\n        local guid = UnitGUID(u)\n        if guid then\n            if aura_env.guids[select(6, strsplit(\"-\", guid))] then\n                local state = allstates[UnitGUID(u)]\n                if state then\n                    local current = UnitPower(u)\n                    state.energy = current\n                    state.changed = true\n                    if current < 85 then\n                        state.show = false\n                        state.changed = true\n                    end\n                end\n                if not state then\n                    local _, _, ID = GetInstanceInfo()\n                    local name = (ID ~= 16 and \"Absorb Inc\") or (ID == 16 and \"Split Inc\")\n                    local icon = (ID ~= 16 and 607865) or (ID == 16 and 460699)\n                    local current = UnitPower(u)\n                    if current >= 85 and name and icon then\n                        allstates[guid] = {\n                            show = true,\n                            changed = true,\n                            progressType = \"static\",\n                            energy = current,\n                            name = name,\n                            icon = icon,\n                        }\n                    end\n                end\n            end\n        end\n    end\n    return true\nend",
