						["custom"] = "function(allstates,event,text,...)\n    if event == \"CHAT_MSG_RAID_BOSS_EMOTE\" then\n        if text then\n            if text:find(\"spell:300807\") then\n                local _, _, ID = GetInstanceInfo()\n                local duration = (ID == 14 and 37.5) or (ID == 15 and 27.5) or (ID == 16 and 35)\n                if duration and aura_env.charges then\n                    allstates[\"charges\"] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = duration,\n                        expirationTime = duration + GetTime(),\n                        autoHide = true,\n                        name = aura_env.charges\n                    }\n                end\n            end\n        end\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID = ...\n        if subEvent == \"SPELL_AURA_REMOVED\" and spellID == 301431 then\n            if allstates[\"charges\"] then\n                allstates[\"charges\"].show = false\n                allstates[\"charges\"].changed = true\n            end\n        end\n    end\n    if event == \"UNIT_SPELLCAST_SUCCEEDED\" then\n        local castGUID, spellID = ...\n        if text and string.match(text, \"raid\") and spellID == 300848 then\n            if allstates[\"charges\"] then\n                allstates[\"charges\"].name = allstates[\"charges\"].name - 1\n                allstates[\"charges\"].changed = true\n            end\n        end\n    end\n    if event == \"ENCOUNTER_START\" then\n        aura_env.charges = 3\n    end\n    return true\nend",
